md"## Aufgabe 1: EKG-Analyse

Die automatische Analyse von EKG-Daten ist eine wichtige Hilfe fÃ¼r die klinische Routine. Durch die Analyse des [QRS-Komplexes](https://de.wikipedia.org/wiki/QRS-Komplex) kann die Herzrate ermittelt werden oder auch Extrasystolen, also unregelmÃ¤ÃŸige, arhythmische HerzschlÃ¤ge identifiziert werden. So kÃ¶nnen schnell Informationen Ã¼ber den Gesundheitszustand eines Patienten gewonnen werden. Im untenstehenden Diagramm sind die einzelnen Abschnitte des EKG-Signals dargestellt. Wir wollen in dieser Ãœbung einen Algorithmus implementieren, der die markante R-Zacke erkennt und zur Auswertung der Herzfrequenz einsetzen.
"

