"

# â•”â•â•¡ 0f4777bd-81b6-4f32-80b9-4028463a8dd0
begin
	ecgdata = load("EKG-Daten-Uebung5.jld2")["data"]
	f_sampling = 2500
	t_ecg = range(0, step=1/f_sampling, length=length(ecgdata))
	plot(t_ecg, ecgdata, xlabel="t/s", ylabel="U/V", label=false)
end

# â•”â•â•¡ 28c5dc82-2ad8-4b67-9cce-69532140b86c
md"Das grobe Vorgehen soll dabei aus folgenden Schritten bestehen:
1. Identifizieren der Zeitpunkte des Signals, an denen die Spannung Ã¼ber einem bestimmten Schwellenwert liegt
2. Aufteilen dieser Zeitpunkte in einzelne Bereiche, die jeweils zu unterschiedlichen R-Zacken gehÃ¶ren
3. Bestimmen des Maximums Ã¼ber jeden Bereich, um die HÃ¶he der R-Zacke zu identifizieren
"

# â•”â•â•¡ 459e8246-3317-46a4-b157-1fb24b49743d
md"
ğŸ“ Finden Sie zunÃ¤chst einen geeigneten Schwellwert, bei dem lediglich die Indizes der R-Zacken gefunden werden. Nutzen Sie diesen Schwellwert, um die Indizes zu bestimmen, an denen das Signal Ã¼ber diesem Schwellwert ist. Sollten dabei mehrere aufeinanderfolgende Indizes gefunden werden, so ist dies fÃ¼r den Moment in Ordnung. Die Vereinzelung findet im nÃ¤chsten Schritt statt.
"

# â•”â•â•¡ 61e18ebb-bed9-4f82-8645-9f1461f2049c
ecgdata

# â•”â•â•¡ fb651817-8436-4509-b372-92be9956c5a4
begin
	threshold = 0.004
	rspike_indices_thresh = findall(x->x>threshold,ecgdata)
end

# â•”â•â•¡ 677185b5-a7c6-44dc-bd79-95a1f91130dd
typeof(rspike_indices_thresh)

# â•”â•â•¡ 428a7687-d96b-44e0-9bb9-bb7afb1d8ef8
if ismissing(threshold)
	keep_working(md"Weisen Sie `threshold` einen passenden Wert zu!")
elseif threshold < 0.0005
	keep_working(md"Der Threshold scheint noch etwas zu klein zu sein!")
elseif ismissing(rspike_indices_thresh)
	keep_working(md"Weisen Sie `rspike_indices_thresh` die Werte Ã¼ber dem Schwellwert zu!")
elseif !all([val in rspike_indices_thresh for val in [1462, 4122, 6711, 9172, 11742, 14406, 17009, 19492, 22193, 24843]])
	keep_working(md"Die erwarteten Positionen der R-Zacken sind bisher nicht im Vektor enthalten!")
elseif any([val in rspike_indices_thresh for val in [3000, 5000, 8000, 10000, 12500, 16000, 18000, 21000, 23000]])
	keep_working(md"Es sind unerwartete Indizes im Vektor enthalten!")
else
	correct(md"Die LÃ¶sung kÃ¶nnte richtig sein. Weiter gehts!")
end

# â•”â•â•¡ 2312430b-2b73-401d-8544-d97b84d7df9d
md"
Je nach Schwellenwert, den Sie im Schritt hier drÃ¼ber verwendet haben, haben Sie jetzt unterschiedlich viele Indizes identifiziert. Wir mÃ¼ssen nun die Liste der Zeitpunkte aufteilen und damit jeweils einer R-Zacke zuordnen. Dies lÃ¤sst sich am einfachsten realisieren, indem Sie nach LÃ¼cken im Vektor `rspike_indices_thresh` suchen.

ğŸ“ Definieren Sie eine MindestlÃ¼ckenbreite `gap_threshold` und finden Sie die Indizes der Werte in `rspike_indices_thresh`, die rechts von einer LÃ¼cke mit der Breite `gap_threshold` liegen. Weisen Sie das Ergebnis der Variablen `gap_indices` zu.
"

# â•”â•â•¡ b9a58ff2-16be-491b-a2a1-90f3f21cce25
begin 
	groupA=Vector{Int64}(undef,10)
	groupB=Vector{Int64}(undef,10)
	groupA[1]=1
	groupB[10]=280
	a=2
	b=1
    width = 10
	for i =2:1:length(rspike_indices_thresh)
	if rspike_indices_thresh[i]-rspike_indices_thresh[i-1]>width
	   groupA[a]=i
	   a=a+1
	   groupB[b]=i-1
	   b=b+1
	end
    end
	
	Vektor = Vector{Vector}(undef,10)
	for i=1:1:10
	Vektor[i]=[rspike_indices_thresh[groupA[i]:1:groupB[i]]]
    end
end

# â•”â•â•¡ 41af50d5-995f-4062-b2e4-468b31e7deca
Vektor

# â•”â•â•¡ 55141420-7813-45e5-91b4-2e31691f2b8c
begin 
    x=1
	gap_threshold = 10
	gap_indices=Vector{Int64}(undef,9)
	for i =2:1:length(rspike_indices_thresh)
	if rspike_indices_thresh[i]-rspike_indices_thresh[i-1]>gap_threshold
	   gap_indices[x]=i
	   x=x+1
	end
    end
end

# â•”â•â•¡ 7b1e68d6-12ac-4c4e-a02b-4f286dd5d53e
if ismissing(gap_threshold)
	keep_working(md"Weisen Sie `gap_threshold` einen passenden Wert zu!")
elseif gap_threshold <= 1
	keep_working(md"Der Threshold scheint noch etwas zu klein zu sein!")
elseif ismissing(gap_indices)
	keep_working(md"Weisen Sie `gap_indices` die Indizes zu, die zwischen den einzelnen Bereichen liegen!")
elseif all(gap_indices==[rspike_indices_thresh[i] for i in 2:length(rspike_indices_thresh) if rspike_indices_thresh[i] - rspike_indices_thresh[i-1] > gap_threshold])
	keep_working(md"Sie haben anscheinend die richtigen Positionen gefunden, allerdings ist der nÃ¤chste Schritt einfacher, wenn Sie nicht die Indizes fÃ¼r das Urpsrungssignal verwenden, sondern die Indizes fÃ¼r die Positionen der LÃ¼cken im Vektor der Peaks (also Indizes fÃ¼r `rspike_indices_thresh`) angeben.")
elseif !all([rspike_indices_thresh[gap_indices[idx_idx]] - rspike_indices_thresh[gap_indices[idx_idx]-1] > gap_threshold for idx_idx in eachindex(gap_indices)])
	keep_working(md"Es scheint noch ein Fehler bei der Bestimmung der LÃ¼cken vorzuliegen!")
else
	correct(md"Die LÃ¶sung sieht gut aus. Weiter gehts!")
end

# â•”â•â•¡ 088f3f76-f7d1-49a8-be5e-5faf216fa8ca
md"
ğŸ“ Aus den Indizes dieser LÃ¼cken ergeben sich die Bereiche des ursprÃ¼nglichen Zeitsignals, die zu einem QRS-Komplex zugehÃ¶rig sind. Nutzen Sie diese Bereiche nun, um jeweils den Index des Maximums jeder R-Zacke zu bestimmen.
"

# â•”â•â•¡ ed3db048-d56f-404c-a3df-6b52d3e90eb2
begin
	rspike_indices_maxima=Vector{Int64}(undef,10)
	for i = 1:1:10
		maxima=findmax(ecgdata[Vektor[i][1]])
		rspike_indices_maxima[i]=Vektor[i][1][maxima[2]]
	end
end

# â•”â•â•¡ c917a964-9605-49fd-953e-aad2fc4cc76d
rspike_indices_maxima

# â•”â•â•¡ 5971febc-76e6-4c00-8b66-deffd44e78b8
hint(md"Die `findmax` Funktion kÃ¶nnte hilfreich sein.")

# â•”â•â•¡ 6f149304-cd3f-4628-aa88-d510b15bc6e1
if ismissing(rspike_indices_maxima)
	keep_working(md"Weisen Sie `rspike_indices_maxima` einen passenden Vektor zu!")
elseif length(rspike_indices_maxima) != 10
	keep_working(md"Es wurden zu viele oder zu wenige R-Zacken detektiert!")
elseif !all(isapprox.(rspike_indices_maxima, [1462, 4122, 6711, 9172, 11742, 14406, 17009, 19492, 22193, 24843], atol=10))
	keep_working(md"Es scheint noch ein Fehler bei der Bestimmung der Maxima vorzuliegen! Die Abweichung zu den erwarteten Werten ist grÃ¶ÃŸer als 10 Indizes.")
else
	correct(md"Das sollte stimmen ğŸ¥³ Sehr gut!")
end

# â•”â•â•¡ 954779d1-7edb-47c1-880b-08c55ceaedc2
