md"## Aufgabe K5 (6 Klausurpunkte): Panâ€“Tompkins-Algorithmus

Mithilfe der Kenntnisse aus den vorherigen Ãœbungen und ein paar ErgÃ¤nzungen lÃ¤sst sich auch ein fortgeschrittener Algorithmus zur robusten Erkennung des QRS-Komplexes implementieren. Der [Panâ€“Tompkins-Algorithmus](https://en.wikipedia.org/wiki/Pan%E2%80%93Tompkins_algorithm) nutzt die Filterung der Daten, um StÃ¶rungen zu entfernen und verwendet dann Informationen Ã¼ber den Signalanstieg zur Detektion der R-Zacke. Ein Teil dieses Algorithmus soll im Folgenden implementiert werden. 
"

# â•”â•â•¡ 705a4aa9-e23a-4e13-abb9-338ca23672a0
advanced(md"Beachten Sie, dass es sich beim Panâ€“Tompkins-Algorithmus eigentlich um einen Algorithmus handelt, der in Echtzeit laufen soll und daher auf Filtern basiert, die sampleweise im Zeitbereich arbeiten. Die benÃ¶tigten Filterungsarten werden erst in Folge-Vorlesungen zur Signalverarbeitung eingefÃ¼hrt. Wenn Sie also dem verlinkten Wikipedia-Artikel nicht folgen kÃ¶nnen, so ist die kein Problem. Wir werden die nÃ¶tigen Schritte einzeln durchgehen.")

# â•”â•â•¡ 1604b47b-779e-42c8-a122-00efa750d914
md"
ğŸ“ Filtern Sie das Signal in `ecgdata` zunÃ¤chst mit einem idealen Bandpass-Filter im Intervall [5 Hz, 15 Hz]. Transformieren Sie das Signal dazu in den Frequenzbereich, setzen Sie die entsprechenden Frequenzkomponenten auf Null und transformieren Sie das Signal zurÃ¼ck in den Zeitbereich. Die Abtastrate ist wie in den anderen Aufgaben in `f_sampling` gegeben. 
"

# â•”â•â•¡ 78df4445-7a91-4bbf-a7a3-d02639e4919a
ecgdataFD = FFTW.rfft(ecgdata)

# â•”â•â•¡ 4a6a6449-1ab3-4ddc-a468-82bb8db8e0a9
function Bandpass_Filter(signal)
	SignalFD_Hz = FFTW.rfft(signal)
	for i=1:1:length(SignalFD_Hz)
		if i>150
	      SignalFD_Hz[i]=0
		end
		if i<50
	      SignalFD_Hz[i]=0
		end	
	end
	signalFiltered_Hz = FFTW.irfft(SignalFD_Hz,length(signal))
return signalFiltered_Hz
end

# â•”â•â•¡ 46ed2744-fefc-4d9d-ab0a-5ce1de5aab78
Bandpass=Bandpass_Filter(ecgdata)

# â•”â•â•¡ e13991c8-cb53-4e06-ba8d-05a9fe4c5e20
plot(t_ecg, Bandpass, xlabel="t/s", ylabel="U/V",size=(1100,500),left_margin = 10Plots.mm,bottom_margin = 10Plots.mm,
	label=false)

