md"
ğŸ“ Tranformieren Sie das differenzierte und quadrierte Signal wieder in den Frequenzbereich und wenden Sie ideales Tiefpassfilter an. Wenden Sie anschlieÃŸend die inverse Fouriertransformation an und plotten Sie das ausgegebene Zeitsignal. Variieren Sie die Grenzfrequenz des Filters so, dass das gefilterte Signal nur noch eine Zacke pro R-Zacke enthÃ¤lt.
"

# â•”â•â•¡ 7f1e4400-974c-4db1-8ca5-a59b1a940516
function Tiefpass(signal,cutoff)
	SignalFD_Hz = FFTW.rfft(signal)
	SignalFD_Hz_new=Vector{ComplexF64}(undef, cutoff)
	for i=1:1:cutoff
	    SignalFD_Hz_new[i]=SignalFD_Hz[i]
	end
return SignalFD_Hz_new
end

# â•”â•â•¡ c64dc5ad-6cce-4653-9ca5-d78de26d9f97
begin
	TiefpassFD=Tiefpass(Ableitung_Quadrat,600)
	Hz=range(0, 30, length=600)
end

# â•”â•â•¡ 82255112-2d5d-4a98-8bec-d7523126f047
