	label=false)

# â•”â•â•¡ 7e315708-024f-4b56-8c28-6115b394d7b3
function Tiefpass_inver(signal,cutoff)
	SignalFD_Hz = FFTW.rfft(signal)
	for i=1:1:length(SignalFD_Hz)
		if i>cutoff
	    SignalFD_Hz[i]=0
		end
	end
return SignalFD_Hz
end

