md"
Nach den vorangegangenen Schritten sollten Sie ein Signal haben, in dem jede R-Zacke durch eine einzige Spitze reprÃ¤sentiert wird, wÃ¤hrend der Rauschhintergrund sehr gering ist. Lediglich an den RÃ¤ndern des Signals kann es zu erhÃ¶hten Werten aufgrund von Randeffekten der Filterung kommen. Im Falle eines kontinuierlich gemessenen und verarbeiteten Signals wÃ¤re dies nicht der Fall. Der so erhaltene Algorithmus ist also aufgrund des hohen Signal-zu-RauschverhÃ¤tnisses sehr robust.

In der typischen Version des Pan-Tompkins-Algorithmus werden nach den Vorverarbeitungsschritten mithilfe mehrerer adaptiver Schwellenwerte die QRS-Komplexe ermittelt. Falls innerhalb einer bestimmten Zeitspanne keine R-Zacken detektiert wurden, wird eine RÃ¼ckwÃ¤rtssuche durchgefÃ¼hrt. Der gesamte Algorithmus arbeitet dabei Sample fÃ¼r Sample. Im Folgenden soll eine vereinfachte Variante implementiert werden, die nur mit einem fixen Threshold arbeitet.

ğŸ“ Bestimmen Sie die Position der R-Zacken bzw. der Spitzen im vorverarbeiteten Signal, die diese reprÃ¤sentieren. Um der Original-Anwendung des Pan-Tompkins-Algorithmus nahe zu bleiben, verwenden Sie eine Schleife, die vorwÃ¤rts durch das vorverarbeitete Signal iteriert und nur Informationen verwendet, die bereits in der Vergangenheit liegen, also nicht auf Indizes zugreift, die von der Schleife noch nicht erreicht wurden. 
* Die [RefraktÃ¤rzeit](https://de.wikipedia.org/wiki/Refrakt%C3%A4rzeit) von Herzmuskelzellen liegt circa bei 300 ms, sodass nach einer R-Zacke innerhalb dieser Zeit keine erneute Erregung zu erwarten ist. Nutzen Sie diese Information in Ihrem Algorithmus, um den Algorithmus robuster zu gestalten.
* Nutzen Sie auÃŸerdem einen geeigneten Threshold, um nur Samples Ã¼ber dem Rauschhintergrund fÃ¼r die Auswertung heranzuziehen.
* Machen Sie sich zu Nutze, dass das Signal nach der Vorverarbeitung nur noch genau einen Scheitelpunkt an jeder R-Zacke hat.
"

# â•”â•â•¡ 9277376f-def2-42ac-99ef-b2ee541d5dca
begin
	R=Vector{Int64}(undef,10)
	Zacken=1
	for i=1:1:length(Tiefpass_Zeit)
	    if Tiefpass_Zeit[i]>8*10^-10
	       if Tiefpass_Zeit[i+1]<Tiefpass_Zeit[i]
			 if  Tiefpass_Zeit[i-1]<Tiefpass_Zeit[i]
				 R[Zacken]=i
				 Zacken=Zacken+1
			 end
		   end
		end
	end
end

